import logo from './logo.svg';
import './App.css';
import './index.js';

function App() {


    return(
         <div className="App">
      <header className="App-header">
      <form name="publish">
            <input type="text" name="message" />
            <input type="submit" value="Send" />
          </form>

          <div id="subscribe">

          </div>
      </header>
    </div>
  );
}

export default App;
